pragma solidity ^0.5.0;

import "./Strings.sol";

contract Complaint {
    struct ComplaintInfo { 
        uint complaintId;
        bytes32 candidateEmail;
        string complain;
        string status;
    }
    using Strings for string;
    
    uint public ComplaintCount;
    
    mapping (uint => ComplaintInfo) public Complaints;
     
    function addComplaint(bytes32 _candidateEmail,string memory _complain,string memory _status) public {
        ComplaintCount++;
        Complaints[ComplaintCount] = ComplaintInfo(ComplaintCount,_candidateEmail,_complain,"Pending");
    }
    
    function changeStatus(uint _candidateId,string memory _status) public
    {
        Complaints[_candidateId].status = _status; 
    }

    function GetCandidateComplaints(bytes32 _candidateEmail) public view returns( string memory) {
        string memory str = "[";
        for(uint i=0;i<=ComplaintCount;i++)
        {
            if(Complaints[i].candidateEmail == _candidateEmail)
            {
                str = str.concat("{ Status: ");
                str = str.concat(Complaints[i].status);
                str = str.concat(",Complain: ");
                str = str.concat(Complaints[i].complain);
                str = str.concat("}");
                if(ComplaintCount!=i)
                    str = str.concat(",");
            }
        }
        str = str.concat("]");
        return str;
    }   
}
